import { Schema, model} from "mongoose";


const taskShema= new Schema({
    nombre:{
        type:String,
        required:true,
        trim:true
    },
    correo:{
        type:String,
        required:true,
        trim:true
    },

    contraseña:{
        type:String,
        required:false, 
        trim:true
    },
    producto:{
        type:String,
        required:false, 
        trim:true
    },
    done:{
        type:Boolean,
        default:false,
    },
},
{
    timestamps:true,
    versionKey:false
}
);


export default  model('Task',taskShema)

